// frontend/src/pages/FindErranderPage.js
import React, { useState, useEffect, useContext } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import { Spinner, Alert, Button, ButtonGroup, Row, Col, Card } from 'react-bootstrap';
import L from 'leaflet';

import erranderService from '../services/erranderService';
import taskService from '../services/taskService';
import AuthContext from '../context/AuthContext';
import './FindErranderPage.css';

// This is a common fix for a known issue with React-Leaflet and Webpack
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

const FindErranderPage = () => {
    const { taskId } = useParams();
    const navigate = useNavigate();
    const { token } = useContext(AuthContext);

    const [erranders, setErranders] = useState([]);
    const [view, setView] = useState('map');
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        const fetchErranders = async () => {
            console.log("--- Starting to fetch erranders ---");
            if (!token) {
                console.error("DEBUG: No token found. Aborting fetch.");
                setLoading(false);
                return;
            }
            try {
                console.log("DEBUG: Calling API to find nearby erranders...");
                const res = await erranderService.findNearby(token);
                
                // THIS IS THE MOST IMPORTANT LOG
                console.log("DEBUG: API Response Received:", res.data);

                setErranders(res.data);
                console.log("DEBUG: Errander state has been set.");

            } catch (err) {
                setError('Could not find available errand runners.');
                console.error("DEBUG: API call failed!", err);
            } finally {
                setLoading(false);
                console.log("--- Finished fetching erranders ---");
            }
        };
        fetchErranders();
    }, [token]);

    const handleSelectErrander = async (erranderId) => {
        // ... same as before
    };
    
    const defaultPosition = [-1.286389, 36.817223];

    // ... rendering logic remains the same ...
    
    if (loading) {
        return <div className="text-center mt-5"><Spinner animation="border" /></div>;
    }

    return (
        <div className="container py-4">
            <h2 className="text-center mb-3">Choose an Errand Runner</h2>
            {error && <Alert variant="danger">{error}</Alert>}

            <ButtonGroup className="view-toggle d-flex justify-content-center mb-4">
                <Button variant={view === 'map' ? 'primary' : 'outline-primary'} onClick={() => setView('map')}>Map View</Button>
                <Button variant={view === 'list' ? 'primary' : 'outline-primary'} onClick={() => setView('list')}>List View</Button>
            </ButtonGroup>
            
            {erranders.length === 0 && !loading && (
                <Alert variant="info" className="text-center">No available errand runners were found. They may be busy or offline.</Alert>
            )}

            {view === 'map' && erranders.length > 0 && (
                <MapContainer center={defaultPosition} zoom={13} style={{ height: '500px', width: '100%' }}>
                     <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
                     {erranders.map(errander => (
                        <Marker key={errander._id} position={[errander.location.coordinates[1], errander.location.coordinates[0]]}>
                           <Popup>
                               <strong>{errander.firstName}</strong><br /> <Button size="sm" onClick={() => handleSelectErrander(errander._id)}>Select</Button>
                           </Popup>
                        </Marker>
                    ))}
                </MapContainer>
            )}

            {view === 'list' && erranders.length > 0 && (
                <Row>
                    {erranders.map(errander => (
                        <Col md={6} lg={4} key={errander._id}>
                            <Card className="errander-list-card">
                                <Card.Body>
                                    <Card.Title>{errander.firstName} {errander.lastName}</Card.Title>
                                    <Button onClick={() => handleSelectErrander(errander._id)}>Select</Button>
                                </Card.Body>
                            </Card>
                        </Col>
                    ))}
                </Row>
            )}
        </div>
    );
};

export default FindErranderPage;
